import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <footer>
      <Container>
          <Row>
              <Col className = "text-center py-3"> LeSport OUTFIT  -  A CHOICE FOR FITNESS
              </Col>
          </Row>
          </Container>
    </footer>
  );
}

export default Footer;
